import React from 'react'
import logo from '../logo.png'; 

export default function Welcome() {
  return (
    <div className='bg-stone-500 flex'>
      {/* hamburger menu */}
      <div className='flex flex-col justify-center items-center w-1/6'>
        <div className='h-2 w-1/2 bg-white rounded-full'></div>
        <div className='h-2 w-1/2 bg-white rounded-full'></div>
        <div className='h-1 w-1/2 bg-white rounded-full'></div>
      </div>
      {/* logo */}
      <img src={logo} alt="" width={50}/>
      <input type="text" />
    </div>
  )
}
